        private readonly string OUTPUT_FILE_NAME = "output_test.xml";
        private readonly string TEST_FILE_NAME = "parse_test.txt";
        private string TestFilePath => Path.Combine(Directory.GetCurrentDirectory(), TEST_FILE_NAME);
        private string OutputFilePath => Path.Combine(Directory.GetCurrentDirectory(), OUTPUT_FILE_NAME);

        [OneTimeSetUp]
        public void SetUp()
        {
            File.WriteAllText(TestFilePath, CHECK_MOD_REPORT);
            if (File.Exists(OutputFilePath))
            {
                File.Delete(OutputFilePath);
            }
        }

        [Test]
        public void Build_Warning_Test()
        {
            CheckModReportFileParser checkModReportFileParser = new CheckModReportFileParser();
            List<TestCase> testCases = checkModReportFileParser.ParseFile(TestFilePath, TestMode.Warning);
            Assert.That(testCases.Any());
            TestResultBuilder builder = new TestResultBuilder();

            TestResultBuilderArgument args = new TestResultBuilderArgument
            {
                TestSuiteName = "TestBuildTest::WARNING", TestCases = testCases
            };
            TestSuites testResult = builder.Build(args);
            Assert.NotNull(testResult);
            XmlSerializer xmlSerializer = new XmlSerializer(testResult.GetType());

            using (Utf8StringWriter textWriter = new Utf8StringWriter())
            {
                xmlSerializer.Serialize(textWriter, testResult);
                string xml = textWriter.ToString();
                Assert.That(!(string.IsNullOrEmpty(xml) && string.IsNullOrWhiteSpace(xml)));
            }

            TestSuiteWriter writer = new TestSuiteWriter();
            writer.WriteToFile(testResult, OutputFilePath);
            Assert.That(File.Exists(OutputFilePath));
        }

        [Test]
        public void Build_Error_Test()
        {
            CheckModReportFileParser checkModReportFileParser = new CheckModReportFileParser();
